import type { FastifyInstance } from "fastify";
import { projectService } from "../services/project.service";
import { FileService } from "../services/file.service";
import {
  createProjectSchema,
  updateProjectSchema,
  projectIdSchema,
  fileContentQuerySchema,
  fileContentBodySchema,
} from "../schemas/project.schema";
import {
  projectsResponseSchema,
  projectResponseSchema,
  errorResponse,
  fileTreeResponseSchema,
} from "../schemas/response.schema";
import type {
  CreateProjectRequest,
  UpdateProjectRequest,
} from "../../shared/types/project.types";

export async function projectRoutes(fastify: FastifyInstance) {
  // Create file service with logger
  const fileService = new FileService(fastify.log);

  /**
   * GET /api/projects
   * Get all projects
   */
  fastify.get(
    "/api/projects",
    {
      preHandler: fastify.authenticate,
      schema: {
        response: {
          200: projectsResponseSchema,
        },
      },
    },
    async (request, reply) => {
      const projects = await projectService.getAllProjects();
      return reply.send({ data: projects });
    }
  );

  /**
   * GET /api/projects/:id
   * Get a single project by ID
   */
  fastify.get<{
    Params: { id: string };
  }>(
    "/api/projects/:id",
    {
      preHandler: fastify.authenticate,
      schema: {
        params: projectIdSchema,
        response: {
          200: projectResponseSchema,
          404: errorResponse,
        },
      },
    },
    async (request, reply) => {
      const project = await projectService.getProjectById(request.params.id);

      if (!project) {
        return reply.code(404).send({
          error: {
            message: "Project not found",
            statusCode: 404,
          },
        });
      }

      return reply.send({ data: project });
    }
  );

  /**
   * POST /api/projects
   * Create a new project
   */
  fastify.post<{
    Body: CreateProjectRequest;
  }>(
    "/api/projects",
    {
      preHandler: fastify.authenticate,
      schema: {
        body: createProjectSchema,
        response: {
          201: projectResponseSchema,
          409: errorResponse,
        },
      },
    },
    async (request, reply) => {
      // Check if project with same path already exists
      const exists = await projectService.projectExistsByPath(request.body.path);
      if (exists) {
        return reply.code(409).send({
          error: {
            message: "A project with this path already exists",
            code: "PROJECT_EXISTS",
            statusCode: 409,
          },
        });
      }

      const project = await projectService.createProject(request.body);
      return reply.code(201).send({ data: project });
    }
  );

  /**
   * PATCH /api/projects/:id
   * Update an existing project
   */
  fastify.patch<{
    Params: { id: string };
    Body: UpdateProjectRequest;
  }>(
    "/api/projects/:id",
    {
      preHandler: fastify.authenticate,
      schema: {
        params: projectIdSchema,
        body: updateProjectSchema,
        response: {
          200: projectResponseSchema,
          404: errorResponse,
        },
      },
    },
    async (request, reply) => {
      // Check if body is empty
      if (Object.keys(request.body).length === 0) {
        return reply.code(400).send({
          error: {
            message: "At least one field must be provided for update",
            code: "VALIDATION_ERROR",
            statusCode: 400,
          },
        });
      }

      const project = await projectService.updateProject(
        request.params.id,
        request.body
      );

      if (!project) {
        return reply.code(404).send({
          error: {
            message: "Project not found",
            statusCode: 404,
          },
        });
      }

      return reply.send({ data: project });
    }
  );

  /**
   * DELETE /api/projects/:id
   * Delete a project
   */
  fastify.delete<{
    Params: { id: string };
  }>(
    "/api/projects/:id",
    {
      preHandler: fastify.authenticate,
      schema: {
        params: projectIdSchema,
        response: {
          200: projectResponseSchema,
          404: errorResponse,
        },
      },
    },
    async (request, reply) => {
      const project = await projectService.deleteProject(request.params.id);

      if (!project) {
        return reply.code(404).send({
          error: {
            message: "Project not found",
            statusCode: 404,
          },
        });
      }

      return reply.send({ data: project });
    }
  );

  /**
   * GET /api/projects/:id/files
   * Get file tree for a project
   */
  fastify.get<{
    Params: { id: string };
  }>(
    "/api/projects/:id/files",
    {
      preHandler: fastify.authenticate,
      schema: {
        params: projectIdSchema,
        response: {
          200: fileTreeResponseSchema,
          403: errorResponse,
          404: errorResponse,
        },
      },
    },
    async (request, reply) => {
      try {
        const files = await fileService.getProjectFiles(request.params.id);
        return reply.send({ data: files });
      } catch (error) {
        // Handle specific error messages
        const errorMessage = (error as Error).message;
        if (errorMessage === 'Project not found') {
          return reply.code(404).send({
            error: {
              message: "Project not found",
              statusCode: 404,
            },
          });
        }
        if (errorMessage === 'Project path is not accessible') {
          return reply.code(403).send({
            error: {
              message: "Project path is not accessible",
              statusCode: 403,
            },
          });
        }

        throw error;
      }
    }
  );

  /**
   * GET /api/projects/:id/files/content
   * Get file content
   */
  fastify.get<{
    Params: { id: string };
    Querystring: { path: string };
  }>(
    "/api/projects/:id/files/content",
    {
      preHandler: fastify.authenticate,
      schema: {
        params: projectIdSchema,
        querystring: fileContentQuerySchema,
        response: {
          200: {
            type: "object",
            properties: {
              content: { type: "string" },
            },
          },
          403: errorResponse,
          404: errorResponse,
        },
      },
    },
    async (request, reply) => {
      try {
        const content = await fileService.readFile(
          request.params.id,
          request.query.path
        );
        return reply.send({ content });
      } catch (error) {
        const errorMessage = (error as Error).message;
        if (errorMessage === "Project not found") {
          return reply.code(404).send({
            error: {
              message: "Project not found",
              statusCode: 404,
            },
          });
        }
        if (
          errorMessage === "File not found or not accessible" ||
          errorMessage === "Access denied: File is outside project directory"
        ) {
          return reply.code(403).send({
            error: {
              message: errorMessage,
              statusCode: 403,
            },
          });
        }

        throw error;
      }
    }
  );

  /**
   * POST /api/projects/:id/files/content
   * Save file content
   */
  fastify.post<{
    Params: { id: string };
    Body: { path: string; content: string };
  }>(
    "/api/projects/:id/files/content",
    {
      preHandler: fastify.authenticate,
      schema: {
        params: projectIdSchema,
        body: fileContentBodySchema,
        response: {
          200: {
            type: "object",
            properties: {
              success: { type: "boolean" },
            },
          },
          403: errorResponse,
          404: errorResponse,
        },
      },
    },
    async (request, reply) => {
      try {
        await fileService.writeFile(
          request.params.id,
          request.body.path,
          request.body.content
        );
        return reply.send({ success: true });
      } catch (error) {
        const errorMessage = (error as Error).message;
        if (errorMessage === "Project not found") {
          return reply.code(404).send({
            error: {
              message: "Project not found",
              statusCode: 404,
            },
          });
        }
        if (errorMessage === "Access denied: File is outside project directory") {
          return reply.code(403).send({
            error: {
              message: errorMessage,
              statusCode: 403,
            },
          });
        }

        throw error;
      }
    }
  );
}

import fs from 'fs/promises';
import path from 'path';
import type { FastifyBaseLogger } from 'fastify';
import type { FileTreeItem } from '../../shared/types/file.types';
import { projectService } from './project.service';

/**
 * File Service
 * Handles file system operations for project file browsing
 */
export class FileService {
  private readonly MAX_DEPTH = 10;
  private readonly EXCLUDED_DIRS = new Set([
    'node_modules',
    'dist',
    'build',
    '.git',
    '.next',
    'coverage',
    '.turbo',
  ]);

  constructor(private logger?: FastifyBaseLogger) {}

  /**
   * Get file tree for a project
   * @param projectId - Project ID
   * @returns File tree structure
   */
  async getProjectFiles(projectId: string): Promise<FileTreeItem[]> {
    // Look up project from database
    const project = await projectService.getProjectById(projectId);

    if (!project) {
      throw new Error('Project not found');
    }

    // Validate that the path is accessible
    try {
      await fs.access(project.path);
    } catch (error) {
      throw new Error('Project path is not accessible');
    }

    // Scan the directory
    const files = await this.scanDirectory(project.path, 0);

    // Sort: directories first, then alphabetically
    return this.sortFileTree(files);
  }

  /**
   * Recursively scan a directory
   * @param dirPath - Directory path to scan
   * @param depth - Current depth (for limiting recursion)
   * @returns Array of file tree items
   */
  private async scanDirectory(
    dirPath: string,
    depth: number = 0
  ): Promise<FileTreeItem[]> {
    // Limit recursion depth
    if (depth > this.MAX_DEPTH) {
      return [];
    }

    const items: FileTreeItem[] = [];

    try {
      const entries = await fs.readdir(dirPath, { withFileTypes: true });

      for (const entry of entries) {
        const fullPath = path.join(dirPath, entry.name);

        // Skip excluded directories
        if (entry.isDirectory() && this.EXCLUDED_DIRS.has(entry.name)) {
          continue;
        }

        // Skip hidden files and directories (starting with .)
        if (entry.name.startsWith('.')) {
          continue;
        }

        try {
          // Get file stats for metadata
          const stats = await fs.stat(fullPath);

          const item: FileTreeItem = {
            name: entry.name,
            path: fullPath,
            type: entry.isDirectory() ? 'directory' : 'file',
            size: entry.isFile() ? stats.size : undefined,
            modified: stats.mtime,
            permissions: this.convertPermissions(stats.mode),
          };

          // Recursively scan subdirectories
          if (entry.isDirectory()) {
            item.children = await this.scanDirectory(fullPath, depth + 1);
          }

          items.push(item);
        } catch (error) {
          // Skip files/dirs with permission errors
          this.logger?.warn({ err: error, path: fullPath }, `Skipping ${fullPath} due to error`);
          continue;
        }
      }
    } catch (error) {
      // Handle permission errors gracefully
      this.logger?.warn({ err: error, path: dirPath }, `Cannot read directory ${dirPath}`);
    }

    return items;
  }

  /**
   * Sort file tree: directories first, then alphabetically
   * @param items - File tree items to sort
   * @returns Sorted file tree items
   */
  private sortFileTree(items: FileTreeItem[]): FileTreeItem[] {
    return items.sort((a, b) => {
      // Directories first
      if (a.type === 'directory' && b.type === 'file') return -1;
      if (a.type === 'file' && b.type === 'directory') return 1;

      // Then alphabetically (case-insensitive)
      return a.name.toLowerCase().localeCompare(b.name.toLowerCase());
    });
  }

  /**
   * Convert Unix permissions to rwx format
   * @param mode - File mode from fs.stats
   * @returns Permission string (e.g., "rw-r--r--")
   */
  private convertPermissions(mode: number): string {
    const perms = [
      (mode & 0o400) ? 'r' : '-',
      (mode & 0o200) ? 'w' : '-',
      (mode & 0o100) ? 'x' : '-',
      (mode & 0o040) ? 'r' : '-',
      (mode & 0o020) ? 'w' : '-',
      (mode & 0o010) ? 'x' : '-',
      (mode & 0o004) ? 'r' : '-',
      (mode & 0o002) ? 'w' : '-',
      (mode & 0o001) ? 'x' : '-',
    ];
    return perms.join('');
  }

  /**
   * Read file content
   * @param projectId - Project ID
   * @param filePath - File path relative to or absolute
   * @returns File content as string
   */
  async readFile(projectId: string, filePath: string): Promise<string> {
    // Look up project from database
    const project = await projectService.getProjectById(projectId);

    if (!project) {
      throw new Error('Project not found');
    }

    // If filePath is not absolute, make it relative to project path
    const absolutePath = path.isAbsolute(filePath) ? filePath : path.join(project.path, filePath);

    // Validate that the file is within the project directory (security check)
    const normalizedProjectPath = path.resolve(project.path);
    const normalizedFilePath = path.resolve(absolutePath);

    // Check if file is within project directory or is a child of it
    const relativePath = path.relative(normalizedProjectPath, normalizedFilePath);
    const isOutside = relativePath.startsWith('..') || path.isAbsolute(relativePath);

    if (isOutside) {
      throw new Error('Access denied: File is outside project directory');
    }

    // Check if file exists and is accessible
    try {
      await fs.access(absolutePath, fs.constants.R_OK);
    } catch (error) {
      throw new Error('File not found or not accessible');
    }

    // Read file content
    try {
      const content = await fs.readFile(absolutePath, 'utf-8');
      return content;
    } catch (error) {
      this.logger?.error({ err: error, path: absolutePath }, 'Error reading file');
      throw new Error('Failed to read file content');
    }
  }

  /**
   * Write file content
   * @param projectId - Project ID
   * @param filePath - File path relative to or absolute
   * @param content - File content to write
   * @returns Success status
   */
  async writeFile(projectId: string, filePath: string, content: string): Promise<void> {
    // Look up project from database
    const project = await projectService.getProjectById(projectId);

    if (!project) {
      throw new Error('Project not found');
    }

    // If filePath is not absolute, make it relative to project path
    const absolutePath = path.isAbsolute(filePath) ? filePath : path.join(project.path, filePath);

    // Validate that the file is within the project directory (security check)
    const normalizedProjectPath = path.resolve(project.path);
    const normalizedFilePath = path.resolve(absolutePath);

    // Check if file is within project directory or is a child of it
    const relativePath = path.relative(normalizedProjectPath, normalizedFilePath);
    const isOutside = relativePath.startsWith('..') || path.isAbsolute(relativePath);

    if (isOutside) {
      throw new Error('Access denied: File is outside project directory');
    }

    // Write file content
    try {
      await fs.writeFile(absolutePath, content, 'utf-8');
      this.logger?.info({ path: absolutePath }, 'File saved successfully');
    } catch (error) {
      this.logger?.error({ err: error, path: absolutePath }, 'Error writing file');
      throw new Error('Failed to write file content');
    }
  }
}

